// Declaração de funções
void countingSort(int*, int);
void printArray(int*, int);
void printSortStats(int, int, double, bool, int, bool);


void countingSort(int* array, int size) {
    clock_t start_time = clock(); // Captura o tempo de início da execução
    int swaps = 0;
    int comparisons = 0;

    // Encontra o valor máximo do vetor
    int max = array[0];
    for (int i = 1; i < size; i++) {
        if (array[i] > max) {
            max = array[i];
        }
    }

    // cria um vetor de contagem dos elementos
    int* count = (int*)calloc(max + 1, sizeof(int));

    // Conta a ocorrência de cada elemento
    for (int i = 0; i < size; i++) {
        count[array[i]]++;
    }

    // sortia o vetor com os elementos do vetor de contagem
    int index = 0;
    for (int i = 0; i <= max; i++) {
        while (count[i] > 0) {
            array[index++] = i;
            count[i]--;
            swaps++;
        }
    }

    free(count);

    clock_t end_time = clock(); // Captura o tempo de fim da execução

    double execution_time = (double)(end_time - start_time) / CLOCKS_PER_SEC;

    printSortStats(comparisons, swaps, execution_time, false, 2, false);
}

void printArray(int* array, int size) {
// Print array
  for (int i = 0; i < size; ++i) {
    printf("%d  ", array[i]);
  }
  printf("\n");
}

